import React, { Component } from 'react';

export default class Pig extends Component {
  selectedPig = '';
  examinePig = e => {
    // this.selectedPig = e.target.id;
    alert(this.props.id);
  };

  render() {
    return (
      <div
        className="pig"
        onMouseOver={this.updateJumbotron}
        onClick={this.examinePig}
      />
    );
  }
}
